import { useNavigate } from "react-router-dom";

const Register = () => {
  const navigate = useNavigate();

  return (
    <div>
      <h3>Bienvenido a la la pagina</h3>
      <h4>de Registro!</h4>
      <form action="">
        <div>
          <div>
            <label htmlFor="nombre">Nombre</label>
            <input
              type="text"
              id="nombre"
              name="nombre"
              placeholder="Nombre..."
              autoComplete="off"
            />
          </div>
        </div>
      </form>
    </div>
    
  );
};

export default Register;
